import styled from '@emotion/styled';
import {
  Accordion,
  AccordionHeader,
  AccordionIcon,
  AccordionItem,
  Box,
  IconButton,
  Input
} from '@chakra-ui/core';

export const StyledButton = styled(IconButton)`
  :disabled {
    opacity: 1;
  }
`;

export const StyledInput = styled(Input)`
  :disabled {
    opacity: 1;
  }
`;

export const StyledInputPW = styled(Input)`
  :disabled {
    opacity: 1;
  }
`;
